import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import HomePage from './components/HomePage'; // Ensure this path is correct
import ServiceCard from './components/ServiceCard';
import './styles/App.css'; // Make sure this file exists and is correctly referenced

const App = () => {
  const services = [
    { name: 'Technology Development', description: 'Innovative solutions for the community.' },
    { name: 'Youth Empowerment', description: 'Programs focused on empowering Africa\'s youth.' }
  ];

  return (
    <div className="app">
      <Header />
      <HomePage />
      <section className="services">
        {services.map((service, index) => (
          <ServiceCard
            key={index}
            name={service.name}
            description={service.description}
          />
        ))}
      </section>
      <Footer />
    </div>
  );
};

export default App;
